import "./styles/Navbar.css"

function Navbar() {
  return (
    <nav className="nav">
      <div className="logo">MyProject</div>
      <ul className="menu">
        <li><a href="/">Home</a></li>
        <li><a href="/projects">Projects</a></li>
        <li><a href="/contact">Contact</a></li>
      </ul>
    </nav>
  );
}

export default Navbar;
